(19, 'Salt substitute, potassium chloride', 0, 0, 0, 0, 0, 0, 0, 33, 0, 0, 0, 0, 0, 'Salt', 'Product sold as a replacement for regular table salt, containing predominantly potassium chloride.'),
(20, 'Salt, table, iodised', 0, 0, 0, 0, 0, 0, 0, 38168, 0, 0, 0, 0, 0, 'Salt', 'Fine granules of sodium chloride sold for direct addition to foods, to which iodine has been added in the form of potassium iodate or iodide. May contain free-flowing agents.'),
(21, 'Salt, table, non-iodised', 0, 0, 0, 0, 0, 0, 0, 38178, 0, 0, 0, 0, 0, 'Salt', 'Fine granules of sodium chloride sold for direct addition to foods. May contain free-flowing agents and small amounts of other minerals such as potassium.'),
(22, 'Stock, dry powder or cube', 215.11, 11.3, 8.9, 0, 0, 4.3, 22.5, 18400, 51.5, 35.97, 7.86, 5.2, 0, 'Stock cubes and seasonings ', 'Concentrated meat stock that is dried and supplied as a powder or compressed into a cube. Contains ingredients such as salt and flavours.'),
(23, 'Taco seasoning mix, chilli-based', 222.51, 5.9, 4.1, 9.9, 0, 19.2, 39.7, 9350, 27.9, 23.6, 48.4, 0, 0, 'Stock cubes and seasonings ', 'Powdered product intended for addition to meat and other ingredients to prepare Mexican-style dishes such as taco filling. Typical ingredients include salt, sugar, maize starch, spices, chilli and citric acid.'),
(24, 'Baking powder, dry powder', 86.28, 0.8, 0.3, 0.4, 0, 0.1, 19.8, 6868, 0, 0, 0, 0, 0, 'Chemical raising agents and cooking ingredients ', 'Fine white powder used to chemically leaven baked goods such as cakes. Composed of 50% cream of tartar, 25% baking soda, and 25% starch.'),
