(27, 'Gelatine, all types', 346.32, 84.4, 0.4, 0, 0, 0, 0, 330, 50, 42.86, 7.14, 0, 0, 'Gelatine ', 'Unflavoured light yellow granular proteinaceous powder. Used to sweeten and thicken soups, sauces and desserts.'),
(28, 'Gluten, from wheat (vital wheat gluten)', 358.99, 75.2, 0, 0.6, 0, 0, 13.2, 29, 21.97, 12.6, 65.51, 0, 0, 'Cereal flours and starches', 'Protein rich extract of wheat flour.'),
