(31, 'Vanilla bean extract', 287.52, 0.1, 0.1, 0, 34.4, 12.6, 12.6, 9, 41.67, 41.67, 16.67, 0, 0, 'Essences', 'Alcoholic extract of the vanilla bean (Vanilla plantifolia or V. tahitensis), used as a flavouring agent.'),
(32, 'Yeast, dry powder', 217.5, 36.4, 5, 26.9, 0, 0, 6.3, 170, 18.79, 80.89, 0.32, 0, 0, 'Yeast', 'A cream or pale grey powder with a fine, smooth texture. Active raising agent used domestically to leaven a wide range of breads, cakes and pastries.'),
(33, 'Beer, high alcohol (5% v/v & above)', 41.59, 0.5, 0, 0, 4.5, 0.2, 2.1, 4, 0, 0, 0, 0, 0, 'Beers, > 3.5% alcohol ', 'Alcoholic beverage characterised by the presence of hops or preparations of hops, prepared by the yeast fermentation of an aqueous extract of malted or unmalted cereals (usually barley), using warm temperature fermentation. Greater than or equal to 5% v/v alcohol.'),
(34, 'Beer, full strength (alcohol 4-4.9% v/v)', 36.33, 0.4, 0, 0, 3.7, 0, 2.3, 5, 0, 0, 0, 0, 0, 'Beers, > 3.5% alcohol ', 'Alcoholic beverage characterised by the presence of hops or preparations of hops, prepared by the yeast fermentation of an aqueous extract of malted or unmalted cereals (usually barley), using low fermentation temperatures. Alcohol content between 4-4.9% v/v alcohol.'),
(35, 'Beer, full strength (alcohol 4-4.9% v/v), carbohydrate modified', 30.11, 0.3, 0, 0, 3.6, 0, 1, 4, 0, 0, 0, 0, 0, 'Beers, > 3.5% alcohol ', 'Alcoholic beverage characterised by the presence of hops or preparations of hops, prepared by the yeast fermentation of an aqueous extract of malted or unmalted cereals (usually barley), resulting in lower final carbohydrate levels than regular beer.  Alcohol content between 4 - 4.9% v/v alcohol.'),
(36, 'Beer, mid-strength (alcohol 3-3.9% v/v)', 30.59, 0.3, 0, 0, 3, 0, 2.2, 3, 0, 0, 0, 0, 0, 'Beers, 1.15- 3.5% alcohol, reduced alcohol / light ', 'Alcoholic beverage characterised by the presence of hops or preparations of hops, prepared by the yeast fermentation of an aqueous extract of malted or unmalted cereals (usually barley), so as to restrict alcohol formation or to remove alcohol after fermentation. Products are described on label as mid strength. Alcohol content between 3-3.9% v/v alcohol.'),
(37, 'Beer, light (alcohol 1- less than 3% v/v)', 23.9, 0.2, 0, 0, 2.1, 0, 2.2, 3, 0, 0, 0, 0, 0, 'Beers, 1.15- 3.5% alcohol, reduced alcohol / light ', 'Alcoholic beverage characterised by the presence of hops or preparations of hops, prepared by the yeast fermentation of an aqueous extract of malted or unmalted cereals (usually barley), so as to restrict alcohol formation or to remove alcohol after fermentation. Products are described on label as Light or Lite. Alcohol content between 1-<3% v/v alcohol.'),
(38, 'Alcoholic beverage, spirit, approximately 40% v/v, all (Brandy, Gin, Rum, Vodka and Whisky)', 213.19, 0, 0, 0, 30.7, 0.1, 0.1, 3, 0, 0, 0, 0, 0, 'Spirits ', 'Includes beverages obtained from the distillation of wine or fermented sugar, cereals or potatoes, or the fermented preparation of grapes or grape products.'),
(39, 'Alcoholic beverage, spirit, approximately 30% v/v, all (Brandy, Gin, Rum, Vodka and Whisky), cooked', 72.18, 0, 0, 0, 10.3, 0.3, 0.3, 2, 0, 0, 0, 0, 0, 'Spirits ', 'Includes beverages obtained from the distillation of wine or fermented sugar, cereals or potatoes, or the fermented preparation of grapes or grape products, that has been heated until a large proportion of alcohol has evaporated.'),
(40, 'Cider, apple (alcohol approximately 4-5% v/v)', 49.95, 0, 0, 0, 3.9, 5.6, 5.6, 3, 0, 0, 0, 0, 0, 'Cider', 'Alcoholic beverage prepared from fermented apples with significant residual sugars. Includes cider produced in Australia, New Zealand and Denmark. Approximately 4% alcohol.'),
(41, 'Wine, red, cabernet sauvignon', 79.35, 0.3, 0, 0, 11, 0.2, 0.2, 4, 0, 0, 0, 0, 0, 'Wines, red (including sparkling varieties and rose styles)', 'Alcoholic beverage produced by fermentation of grape juice from the cabernet sauvignon grape, with prolonged grape skin contact to produce wine of a deep red colour. Includes wine produced in Australia. Approximately 12% v/v alcohol.'),
(42, 'Wine, red, merlot', 78.87, 0.3, 0, 0, 10.9, 0.4, 0.4, 5, 0, 0, 0, 0, 0, 'Wines, red (including sparkling varieties and rose styles)', 'Alcoholic beverage produced by fermentation of grape juice from the merlot grape, with prolonged grape skin contact to produce wine of a deep red colour. Includes wine produced in Australia and New Zealand. Approximately 12% v/v alcohol.'),
(43, 'Wine, red, pinot noir', 76.72, 0.2, 0, 0, 10.7, 0.2, 0.2, 3, 0, 0, 0, 0, 0, 'Wines, red (including sparkling varieties and rose styles)', 'Alcoholic beverage produced by fermentation of grape juice from the pinot noir grape, with prolonged grape skin contact to produce wine of a deep red colour. Includes wine produced in Australia and New Zealand. Approximately 12% v/v alcohol.'),
(44, 'Wine, red, shiraz', 81.74, 0.2, 0, 0, 11.5, 0.2, 0.2, 7, 0, 0, 0, 0, 0, 'Wines, red (including sparkling varieties and rose styles)', 'Alcoholic beverage produced by fermentation of grape juice from the shiraz grape, with prolonged grape skin contact to produce wine of a deep red colour. Includes wine produced in Australia only. Approximately 12% v/v alcohol.'),
(45, 'Wine, red', 80.07, 0.2, 0, 0, 11.2, 0.2, 0.2, 5, 0, 0, 0, 0, 0, 'Wines, red (including sparkling varieties and rose styles)', 'Alcoholic beverage produced by fermentation of grape juice with prolonged grape skin contact to produce wine of a deep red colour. Approximately 12% v/v alcohol.'),
(46, 'Wine, red, cooked', 28.92, 0.3, 0, 0, 3.9, 0.2, 0.2, 5, 0, 0, 0, 0, 0, 'Wines, red (including sparkling varieties and rose styles)', 'Alcoholic beverage produced by fermentation of grape juice with prolonged contact with grape skins, that has been heated until the majority of alcohol has evaporated.'),
(47, 'Wine, red, sparkling', 80.78, 0.2, 0, 0, 10.3, 2, 2, 7, 0, 0, 0, 0, 0, 'Wines, red (including sparkling varieties and rose styles)', 'Alcoholic beverage produced by fermentation of grape juice from red wine grapes, retaining significant quantities of dissolved carbon dioxide. Approximately 13% v/v alcohol.'),
(48, 'Wine, rose', 69.07, 0.2, 0, 0, 9.4, 0.7, 0.7, 5, 0, 0, 0, 0, 0, 'Wines, red (including sparkling varieties and rose styles)', 'Alcoholic beverage produced by fermentation of grape juice so that the wine has a pale pink colour. Includes wine produced in Australia and New Zealand. Approximately 13% v/v alcohol.'),
(49, 'Wine, white, sauvignon blanc', 70.75, 0.2, 0, 0, 9.9, 0.1, 0.1, 2, 0, 0, 0, 0, 0, 'Wines, white (including sparkling varieties)', 'Alcoholic beverage produced by fermentation of grape juice from the sauvignon blanc grape, produced with little contact with grape skins so that the wine is pale yellow in colour with little sugars remaining. Includes wine produced in Australia and New Zealand. Approximately 12% v/v alcohol.'),
(50, 'Wine, white, semillon', 64.53, 0.2, 0, 0, 9, 0.2, 0.2, 6, 0, 0, 0, 0, 0, 'Wines, white (including sparkling varieties)', 'Alcoholic beverage produced by fermentation of grape juice from the semillon grape, produced with little contact with grape skins so that the wine is pale yellow in colour with little sugars remaining. Includes wine produced in Australia only. Approximately 12% v/v alcohol.'),
(51, 'Wine, white, chardonnay', 74.33, 0.3, 0, 0, 10.3, 0.3, 0.3, 4, 0, 0, 0, 0, 0, 'Wines, white (including sparkling varieties)', 'Alcoholic beverage produced by fermentation of grape juice produced from the chardonnay grape, with little contact with grape skins so that the wine is pale yellow in colour with little sugars remaining. Includes wine produced in Australia. Approximately 13% v/v alcohol.'),
(52, 'Wine, white, riesling', 69.79, 0.2, 0, 0, 9.6, 0.4, 0.4, 7, 0, 0, 0, 0, 0, 'Wines, white (including sparkling varieties)', 'Alcoholic beverage prepared by fermentation of grape juice produced from the riesling grape, with little contact with grape skins so that the wine is pale yellow in colour with some sugars remaining. Includes wine produced in Australia. Approximately 12% v/v alcohol.'),
(53, 'Wine, white', 71.94, 0.3, 0, 0, 10, 0.2, 0.2, 4, 0, 0, 0, 0, 0, 'Wines, white (including sparkling varieties)', 'Alcoholic beverage produced by fermentation of grape juice, produced with little contact with grape skins so that the wine is pale yellow in colour. Approximately 12% v/v alcohol.'),
(54, 'Wine, white, cooked', 25.57, 0.2, 0, 0, 3.4, 0.3, 0.3, 5, 0, 0, 0, 0, 0, 'Wines, white (including sparkling varieties)', 'Alcoholic beverage produced by fermentation of grape juice with little contact with grape skins, then heated until the majority of alcohol has evaporated.'),
(55, 'Wine, white, sparkling', 73.14, 0.2, 0, 0, 9.8, 1, 1, 2, 0, 0, 0, 0, 0, 'Wines, white (including sparkling varieties)', 'Alcoholic beverage prepared by fermentation of grape juice produced with little grape skin contact so that the wine is pale yellow in colour and retains significant quantities of dissolved carbon dioxide. Includes wine described as brut or semi-brut in style produced in Australia and France. Approximately 12% v/v alcohol.'),
(56, 'Wine, white, sweet dessert style', 118.79, 0.4, 0, 0, 8.4, 14.7, 14.7, 13, 0, 0, 0, 0, 0, 'Wines, white (including sparkling varieties)', 'Alcoholic beverage prepared by fermentation of grape juice with little grape skin contact, so that the wine is golden in colour and retains a high level of residual sugars (approximately 10% sugars). Includes botrytised wine produced in Australia and New Zealand. Approximately 10% v/v alcohol.'),
(57, 'Wine, fortified, port', 143.4, 0.2, 0, 0, 13.6, 12.4, 12.4, 15, 0, 0, 0, 0, 0, 'Fortified wines ', 'Sweet, alcoholic beverage prepared from fermented grape juice to which additional alcohol is added. Approximately 16% v/v alcohol.'),
