(59, 'Wine, fortified, sherry, sweet style (approximately 11% sugars)', 137.91, 0.2, 0, 0, 13.6, 11.1, 11.1, 18, 0, 0, 0, 0, 0, 'Fortified wines ', 'Fermented grape juice to which additional alcohol is added and with a high sugars content (approximately 11%) and a sweet flavour. Approximately 17.0% v/v alcohol.'),
(60, 'Cocoa powder', 259.56, 20.5, 15.2, 27.7, 0, 1.5, 10.5, 81, 63.3, 32.5, 3.4, 0, 0, 'Unfortified dry beverage flavourings', 'Powder produced from the liquor extracted from cocoa beans. Typically used to flavour beverages and in baking.'),
(61, 'Beverage base, chocolate flavour, added vitamins A, B1, B2, C & D, Ca & Fe (Milo)', 380.98, 12.7, 10.4, 9.1, 0, 47.3, 61.2, 75, 66.6, 25.61, 3.22, 4.9, 10, 'Fortified dry beverage flavourings', 'Dry beverage base used to prepare a chocolate flavoured beverage with the addition of milk. Contains added iron, calcium and vitamins A, B1, B2, C and D. Typical ingredients include malted cereals, milk solids and cocoa. Milo brand is an example of such a product.'),
(62, 'Beverage, chocolate flavour, from Milo powder, with regular fat cows milk', 95.12, 4.2, 4, 0.8, 0, 9.6, 10.9, 39, 0, 0, 0, 0, 10, 'Fortified beverage flavourings prepared with water or milk', 'Beverage prepared by mixing milo powder with regular fat cows milk.'),
(63, 'Beverage base, drinking chocolate, unfortified', 357.55, 5.6, 4.8, 1.5, 0, 74.3, 76.3, 160, 62.8, 30.49, 2.48, 4.9, 0, 'Unfortified dry beverage flavourings', 'Unfortified powdered mixture of sugar and cocoa or chocolate used for mixing with milk or water to produce a beverage. Other ingredients may include maltodextrin, milk solids, soy lecithin, salt, flavour.'),
