(73, 'Cordial base, 25% citrus fruit juice, regular', 144.84, 0, 0, 0, 0, 37.3, 37.3, 12, 0, 0, 0, 0, 0, 'Cordial concentrate ', 'Concentrated sugar-based syrup containing a minimum of 25% citrus fruit juice (typically orange or lemon juice), used to prepare a beverage by dilution with water.'),
