(79, 'Fruit drink, apple juice', 38.72, 0, 0, 0, 0, 9.8, 9.8, 7, 0, 0, 0, 0, 0, 'Fruit drinks (ready to drink or made from concentrate)', 'Commercially prepared product made from 25% apple juice or puree, water, sugars and food acids. Does not contain added vitamin C.'),
