(445, 'Soy beverage, reduced fat (1% fat), added Ca & vitamins A, B1, B2 & B12', 43.5, 3, 0.9, 0.6, 0, 1.7, 5.7, 45, 17.4, 22.4, 60, 0.9, 0, 'Soy-based beverage, plain, reduced fat, fortified', 'A dairy milk substitute prepared from soy beans with a reduced fat content of ~1%. Contains added calcium, potassium, magnesium, vitamins A, B1, B2 and B12.'),
(446, 'Sausage, vegetarian style, unfortified, raw', 190.01, 19, 9.4, 1.5, 0, 1.9, 7.4, 600, 9.85, 64.25, 24.3, 0.2, 0, 'Meat substitutes', 'Sausages made from chopped, minced, or blended vegetables and/or legumes and other ingredients such as spices, sugar and salt. Does not contain added vitamins or minerals.'),
(447, 'Sausage, vegetarian style, added Fe, Zn and vitamin B12, raw', 190.01, 19, 9.4, 1.5, 0, 1.9, 7.4, 600, 9.85, 64.25, 24.3, 0.2, 0, 'Meat substitutes', 'Sausages made from chopped, minced, or blended vegetables and/or legumes and other ingredients such as spices, sugar and salt. Contains added iron, zinc and vitamin B12.'),
(448, 'Sausage, vegetarian style, fried, no added fat', 200.05, 20, 9.9, 1.6, 0, 2, 7.8, 632, 0, 0, 0, 0, 0, 'Meat substitutes', 'Sausages made from chopped, minced, or blended vegetables and/or legumes and other ingredients such as spices, sugar and salt. May contain added iron, zinc and vitamin B12. Cooked by frying with out added fat.'),
(449, 'Tofu (soy bean curd), firm, as purchased', 113.29, 12, 7.3, 3.5, 0, 0, 0, 40, 14.3, 24.4, 60.6, 0, 0, 'Meat substitutes', 'Commercially prepared soy bean extract, that has set to a firm texture. Ingredients include water, soy beans, glucono-delta lactone, and nigari (magnesium chloride).'),
(450, 'Yoghurt, soy based, berry flavoured, regular fat (3% fat)', 99.19, 3.7, 3.7, 0.2, 0, 8.4, 12.6, 55, 14.3, 44.7, 41, 0, 0, 'Soy-based yoghurts, regular fat', 'Yoghurt-style sweet product based on soy milk rather than dairy milk, with added berry flavour and formulated to have a fat content of approximately 3%..'),
(451, 'Yoghurt, soy based, vanilla flavoured, reduced fat (1% fat)', 73.37, 3.7, 0.8, 0.2, 0, 8.4, 12.6, 55, 14.3, 44.7, 41, 0, 0, 'Soy-based yoghurts, reduced fat', 'Yoghurt-style sweet product based on soy milk rather than dairy milk, with added vanilla flavour and formulated to have a fat content of approximately 1%.'),
(452, 'Butter, plain, salted', 723.47, 1.1, 81.3, 0, 0, 0, 0, 776, 69.58, 20.92, 1.94, 6.2, 167, 'Butter', 'A product derived exclusively from milk and products obtained from milk, principally in the form of an emulsion of the type water-in-oil, containing no less than 80% milk fat. Contains added salt.'),
(453, 'Butter, plain, no added salt', 723.47, 1.1, 81.3, 0, 0, 0, 0, 10, 69.58, 20.92, 1.94, 6.2, 167, 'Butter', 'A product derived exclusively from milk and products obtained from milk, principally in the form of an emulsion of the type water-in-oil, containing no less than 80% milk fat. Does not contain added salt.'),
(454, 'Ghee, clarified butter', 884.56, 0.3, 99.9, 0, 0, 0, 0, 2, 69.58, 24.92, 1.92, 6.2, 290, 'Butter products', 'Indian-style clarified butter containing at least 99.7% milk fat, used mainly in cooking.'),
(455, 'Dairy blend, butter & edible oil spread (approximately 80% fat), sodium 600 mg/100 g', 696.7, 0.5, 78.1, 0, 0, 0.6, 1, 611, 45.66, 39.98, 13.48, 3.2, 150, 'Dairy blend, regular, fat content ? 65g/100g', 'A spread that is a blend of approximately two-thirds butter and one-third vegetable oil, generally canola oil, with a fat content of approximately 80%. Contains added salt and vitamins A and D.'),
(456, 'Dairy blend, butter & edible oil spread (approximately 80% fat), reduced salt (sodium 400 mg/100 g)', 696.7, 0.5, 78.1, 0, 0, 0.6, 1, 410, 47.8, 37.8, 12, 1.3, 150, 'Dairy blend, regular, fat content ? 65g/100g', 'A spread that is a blend of approximately two-thirds butter and one-third vegetable oil, generally canola oil with a fat content of approximately 80%. Contains a lower salt content than regular dairy blend and added vitamins A and D.'),
(457, 'Margarine spread, polyunsaturated (70% fat)', 609.94, 0, 69, 0, 0, 0, 0, 562, 22.44, 32.67, 45.5, 0.2, 0, 'Polyunsaturated margarine spreads, fat content ? 65g/100g', 'A polyunsaturated edible oil spread containing approximately 70% fat, the majority of which are polyunsaturated edible oils (including sunflower oil). Contains added salt and vitamins A and D.'),
(458, 'Margarine spread, polyunsaturated (70% fat), reduced salt (sodium 280 mg/100 g)', 630.02, 1, 70.8, 0, 0, 0, 0, 283, 25.62, 30.04, 44.72, 0.3, 0, 'Polyunsaturated margarine spreads, fat content ? 65g/100g', 'A polyunsaturated edible oil spread containing approximately 70% polyunsaturated edible oils (including sunflower oil). Formulated to have a reduced salt content. Contains added vitamins A and D.'),
(459, 'Margarine spread, monounsaturated (80% fat), rice bran oil, unfortified', 717.73, 0.3, 81, 0, 0, 0, 0, 580, 28.25, 40, 30.96, 0.9, 0, 'Monounsaturated margarine spreads, fat content ?65 g/100g', 'A monounsaturated edible oil spread containing approximately 80% rice bran oil. Contains added salt, but does not contain added vitamins or minerals.'),
