(461, 'Margarine spread, monounsaturated (greater than 65% fat)', 597.51, 0.5, 67.3, 0, 0, 0, 0, 795, 23.1, 50.18, 26, 0.9, 0, 'Monounsaturated margarine spreads, fat content ?65 g/100g', 'A monounsaturated edible oil spread containing approximately 65%  or more edible oils including canola oil, olive oil or blends of monounsaturated oils. Contains added salt and vitamins A and D.'),
(462, 'Margarine spread, monounsaturated (greater than 65% fat), reduced salt (sodium 360 mg/100 g)', 613.05, 1, 68.9, 0, 0, 0, 0, 362, 24.05, 51.15, 24.43, 0.9, 0, 'Monounsaturated margarine spreads, fat content ?65 g/100g', 'A monounsaturated edible oil spread containing approximately 65% monounsaturated edible oils including canola oil, olive oil or blends of monounsaturated oils. Formulated to have a reduced salt content. Contains added vitamins A and D.'),
(463, 'Margarine spread, monounsaturated, reduced fat (55% fat) & salt (sodium 380 mg/100 g)', 459.37, 1, 51.5, 0, 0, 0, 0, 338, 23.4, 50.7, 24.9, 1.5, 0, 'Monounsaturated margarine spreads,fat content <65 g/100g', 'A monounsaturated edible oil spread containing approximately 55% monounsaturated edible oils including canola oil, olive oil or blends of monounsaturated oils. Formulated to have a reduced salt content. Contains added vitamins A and D'),
