(465, 'Margarine spread, olive oil blend (65% fat), reduced salt (sodium 360mg/100 g)', 575.29, 1, 64.6, 0, 0, 0, 0, 355, 26.42, 44.58, 28.36, 0.9, 0, 'Monounsaturated margarine spreads,fat content <65 g/100g', 'A monounsaturated edible oil spread containing approximately 65% monounsaturated olive oil. Formulated to have a reduced salt content. Contains added vitamins A and D.'),
