(469, 'Oil, canola', 884.32, 0, 100, 0, 0, 0, 0, 0, 7.63, 62.09, 29.81, 0, 0, 'Monounsaturated oils ', 'Edible oil extracted from the seeds of the canola plant (Brassica napus or Brassica campestris). Although derived from the same plant, canola oil is not rapeseed oil, and it is distinguished by low levels of erucic acid.'),
